class CotacaoDTO {
  final int? id;
  final String? ativo;
  final DateTime? dtCotacao;
  final double? valor;

  CotacaoDTO({this.id, this.ativo, this.dtCotacao, this.valor});

  factory CotacaoDTO.fromJson(Map<String, dynamic> json) {
    return CotacaoDTO(
      id: json['id'],
      ativo: json['ativo'],
      dtCotacao: DateTime.parse(json['dtCotacao']),
      valor: json['valor'].toDouble(),
    );
  }
}
